import styled from "styled-components";

export const LJRankingTitleWrapper = styled.div`
  display: flex;

  .image {
    position: relative;
    padding: 3px;
    border: 1px solid #ccc;

    img {
      width: 150px;
      height: 150px;
    }
  }

  .mask {
    width: 150px;
    height: 150px;
    background-position: -230px -380px;
    position: absolute;
  }

  img {
  }
`;
